import { useEffect, useState } from 'react';

export default function Notes() {
  const [note, setNote] = useState()

  useEffect(() => {
    fetch('http://localhost:8000/note')
      .then(res => res.json())
      .then(data => {
        setNote(data)
      })
  }, [])

  return (
    <div>
      Notes page
    </div>
  )
}
